import React from "react";
import "./Projects.css";

export default function Projects() {
    return (
        <div class="container">
            <h2>About Me</h2>
            <div class="row">
            <div class="col-12 col-md-4">
                <img src="../../public/logo192.png" alt="Profile Picture"/>
            </div>
            <div class="col-12 col-md-8">
                <p>Hi there! My name is John Doe and I'm a web developer based in Paris, France. I have over 5 years of experience in developing websites and web applications using HTML, CSS, JavaScript, and PHP.</p>
                <p>I love creating beautiful and functional websites that help businesses and individuals achieve their goals online. When I'm not coding, you can find me hiking in the mountains or trying out new restaurants in the city.</p>
                <p>Feel free to contact me if you have any questions or if you'd like to work together on a project.</p>
                <a href="#" class="btn">Contact Me</a>
            </div>
            </div>
        </div>
    );
}
